import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { ProfileProvider } from "./context/ProfileContext"; // Ensure the ProfileContext is provided
import "./styles/App.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <ProfileProvider> {/* Wrap the entire app with the Profile Context */}
            <App />
        </ProfileProvider>
    </React.StrictMode>
    );
